import './App.css';
import Header from "./Header";
import danki_bg from "./resources/danki_bg.jpg"

function App() {
  return (
    <div className="App">
      <Header/>

      <div className="storiesCard" style = {{backgroundImage:`url(${danki_bg})`}}>
        <p> William Jefferson</p>
      </div>
    </div>
  );
}

export default App;
